import { StyleSheet } from "react-native";

export default StyleSheet.create({
    body: {
        display: 'flex',
        alignItems: 'center',
        backgroundColor: '#252525',
        height: '100%',
    },
    header: {
        marginTop: 20,
        fontSize: 20,
        fontWeight: 'bold',
        color: '#fff'
    },
    inputs:{
        marginTop: 50,
        marginBottom: 50,
    },
    input:{
        borderWidth: 1,
        borderColor: '#fff',
        margin: 15,
        padding: 5, 
        color: '#fff',

    },
    btn:{
        borderWidth: 1,
        borderColor: '#fff',
        backgroundColor: '#aaa',
        padding: 5,
    }
})
